import axios from "axios";

const fetchProducts = () => {
  return axios
    .get("http://localhost:3001/api/productos/taladro", {
      headers: {
        "Content-Type": "application/json",
      },
    })
    .then((response) => {
      //console.log(response.data);
      return response.data;
    });
};

export default fetchProducts;
